Register variables are variables that are stored in a register instead of RAM. The register keyword is used to declare a register variable. The register keyword is a request to the compiler to store the variable in a register. However, the compiler may choose to ignore this request if there are not enough registers available.
Here is an example of static and register variables in C:
```
#include <stdio.h>

void func() {
    static int x = 10; // static variable
    register int y = 20; // register variable

    printf("x = %d\n", x);
    printf("y = %d\n", y);

    x++;
    y++;
}

int main() {
    func();
    func();
    return 0;
}
```
