  const totalBits = entities.length * 7;
  const sizeInBytes = Math.ceil(totalBits / 8);
  const arrayBuffer = new ArrayBuffer(sizeInBytes);
  const dataView = new DataView(arrayBuffer);

  let byteIndex = 0;
  let bitIndex = 0;

